import styled from "styled-components";

export const Container = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  width: 100vw;
  height: 100vh;
`;

export const Content = styled.div`
  gap: 15px;
  display: flex;
  align-items: center;
  justify-content: center;
  flex-direction: column;
  width: 100%;
  box-shadow:  30px 30px 100px #636363,
             -30px -30px 100px #ffffff;
  background-color: white;
  max-width: 350px;
  padding: 20px;
  border-radius: 5px;
`;
